import React from 'react'
import Navbar from '../Navbar/Navbar'
import {MagazineContainer, 
        MagazineImage, 
        MagazineTitle, 
        MagazineSubtitle} from "./MagazineElements";

import magazineBg from '../../images/vintage.png'

const Magazine = () => {
    return (
        <div>
            <Navbar />
            <MagazineContainer>
                <MagazineImage src={magazineBg}/>
                    <MagazineTitle>Where beauty meets style</MagazineTitle>
                    <MagazineSubtitle></MagazineSubtitle>
                
            </MagazineContainer>
        </div>
    )
}

export default Magazine
